def Fibonacci(N):    '''    Fonction qui prend en entrée un entier N > 1 et ne renvoie rien.    Elle affiche les N premiers termes de la séquence de Fibonacci    Par ex: Fibonacci(5) affichera successivement 0, 1, 1, 2, et 3.    '''    ValPrec = 0    ValCur = 1    print(ValPrec)    for i in range(1, N):        print(ValCur)        Suivant = ValPrec + ValCur        ValPrec = ValCur        ValCur = Suivant